procedure fibonacci(x)
{
	//root.console.print(x.toString());
	if(x.lt(2))
	{
		if(x.equals(0))		
			_result=0;
		else
			_result=1;		
	}	
	else
		_result = _self.fibonacci(x.min(1)).plus( _self.fibonacci(x.min(2)) );			
}

procedure sum(n)
{
	if(n.equals(1))
		_result = 1;
	else
	{
		n2 = n.min(1);
		s2 = _self.sum(n2);
		_result = n.plus(s2);
	}
}

procedure(obj, config)
{
	html = "<UL>";
	for(i=0;i.lt(obj.size();i.inc(1)))
	{
		html.concat("<LI>");
		item = obj.get(i);
		itemComponentPath = "_root.lib.web.components.".concat(item._system.html.component);
		itemComponent = _root.core.system.object.getByPath(_root, itemComponentPath);
		itemConfig = item._system.html.config;
		html.concat(itemComponent.toHtml(item,itemConfig):
		html.concat("</LI>");
	}

	html.concat("</UL>");

	_result = html;
}

