}

procedure(obj, config)
{	
	SYSTEM = _root.core.system;
	WEB = _root.lib.web;

	tag = config.tag;
	startTag = "<".concat(tag).concat(">");
	endTag = "</".concat(tag).concat(">");

	elementTag = config.elementTag;
	startElementTag = "<".concat(elementTag).concat(">");
	endElementTag = "</".concat(elementTag).concat(">");


	html = startTag;
	//iterate elements
	fieldNames = SYSTEM.object.listFields(obj);
	for(i=0;i.lt(fieldNames.size());i.inc(1))
	{
		html = html.concat(startElementTag);

		fieldName = fieldNames.get(i);
		element = SYSTEM.object.getChild(obj, fieldName);
		elementHtml = _self.renderObject(element);
		html = html.concat(elementHtml);

		html =  html.concat(endElementTag);
	}

	html =  html.concat(endTag);
	_result = html;
}

procedure(target)
{
	SYSTEM = _root.core.system;
	COMPONENTS = _root.lib.web.components;

	_html = SYSTEM.object.getMetaField(target, "html");

	if(SYSTEM.isNull(_html).isFalse())
	{

	component = _html.component;
	if(SYSTEM.isNull(component).isFalse())
	{
		_result = component.toHtml(target);
	}
	else
	{
		component = _html.generatedComponent;
		if(SYSTEM.isNull(component).isFalse())
		{
			_result = component.toHtml(target);
		}
		else
		{
			//try to generate component from clue
			if(SYSTEM.isNull(_html.componentName).isFalse())
			{

				_result = _self.renderByStandardComponent(target);
			}
		}


	}

	}
	//_root.core.system.console.println("html=".concat(_result));


}

procedure(target)
{
	SYSTEM = _root.core.system;
	COMPONENTS = _root.lib.web.components;

	_html = SYSTEM.object.getMetaField(target, "html");

	component = SYSTEM.object.getByPath(COMPONENTS, _html.componentName);
	_result = component.toHtml(target, _html.componentConfig);
}

