procedure ()
{

	//1. fetch active MAC from AP
	host -> http://root@jackap6;

	data -> host."Status_Wireless.live.asp"();
	//root.console.print(data);
	macList -> _root.lib.device.LinkSysE3000.statusWirelessLiveGetMacList(data);
	macList._prototype -> _root.prototype.list;

	for(i->0;i.lt(macList.size());i.inc(1))
	{
		mac = macList.get(i);		
		//root.console.print(mac);		
		now = _root.lib.system.now();

		_self.activeMacs.$mac=now;
	}


	maxIdleTime -> _self.maxIdleTime.mul(1000);

	//2. get list of inactive MACs
	activeMacs -> _self.activeMacs;	
	activeMacs._prototype -> _root.prototype.list;
	//activeMacs.clear();

	toBeRemovedMacs -> {};
	toBeRemovedMacs._prototype=_root.prototype.list;
	for(i=0;i.lt(activeMacs.size());i.inc(1))
	{
		mac = activeMacs.get(i);

		now = _root.lib.system.now();

		elapse = now.ticks().min( mac.ticks());
		if(elapse.gt(maxIdleTime))
			toBeRemovedMacs.add(mac);	

	}

	//3. remove inactive MACs
	for(i=0; i.lt(toBeRemovedMacs.size());i.inc(1))
	{
		mac = toBeRemovedMacs.get(i);
		activeMacs.$mac = null;
		_root.console.print(mac.concat(" removed."));
	}

}

